webpackJsonp([25472699280581],{416:function(a,e){a.exports={data:{site:{siteMetadata:{title:"MAC0215 Blog",author:"Victor Hugo M. Pinto"}},markdownRemark:{id:"/Users/victorhugo/BCC/mac0215-blog/src/pages/visualização-de-dados-I/index.md absPath of file >>> MarkdownRemark",html:"<p>Durante a semana dos dias 14 a 20 de outubro, trabalhamos na criação de <em>Jupyter Notebooks</em> para visualizar os dados referêntes a cada coluna das planilhas de inscritos por meio de gráficos.</p>\n<p>Com esses <em>Notebooks</em>, esperamos detectar padrões e até inferir relações não encontradas até então entre os dados de diferentes edições do HackathonUSP. Além disso podemos identificar particularidades de cada edição e até estudar o impacto de uma determinada edição ser aberta ao público de fora da USP no tocante a distribuição de gênero, especialidades, participação em edições anteriores de outros hackathons e porcentagem de inscritos com um time montado.</p>\n<p>As observações feitas sobre cada coluna, em cada edição fará parte dos <em>Notebooks</em>.</p>\n<p>Em paralelo, iniciamos a preparação para testar o modelo de Regressão Linear, em um <em>Jupyter Notebook</em> separado, porém ainda estamos na etapa de <em>data preprocessing</em>. Durante a próxima semana esperamos conseguir testar o modelo completamente e obter alguma medida a partir da validação cruzada.</p>\n<p><strong>Horas</strong>: 7 horas</p>",frontmatter:{title:"Visualização dos dados",date:"October 20, 2018"}}},pathContext:{slug:"/visualização-de-dados-I/",previous:{fields:{slug:"/reunião-11-10/"},frontmatter:{title:"Reunião (11/10)"}},next:null}}}});
